INSERT INTO `node__body` VALUES ('tool',0,1,19,'en',0,'<p>an instance of a number of people embracing one another simultaneously, typically to provide support or express solidarity.<br />\r\n\"no alternative therapy workshop would be complete without group hugs\"</p>\r\n','','basic_html'),('tool',0,1,19,'nl',0,'<p>Knuffelen kan bijdragen aan het groepsgevoel! Een voorbeeld van een aantal mensen die elkaar gelijktijdig omhelzen, meestal om ondersteuning te bieden of solidariteit te betuigen.&nbsp;\"geen alternatieve therapie-workshop zou compleet zijn zonder groepsomhelzingen\"</p>\r\n','','basic_html'),('tool',0,2,20,'en',0,'<p>A steadily increasing number of zoos and aquariums have recognised that the real challenge of biodiversity conservation is saving wild species and habitats ( see WAZA conservation projects). It is the aim of WAZA to further increase the number of zoos and aquariums involved in the conservation of wild species and .. <a href=\"/en/taxonomy/term/37\">Waag</a></p>\r\n','','basic_html'),('tool',0,2,20,'nl',0,'<p>Steeds meer dierentuinen en aquariums hebben ingezien dat de echte uitdaging van behoud van biodiversiteit het behoud van wilde soorten en habitats is (zie beschermingsprojecten voor WAZA). Het is de bedoeling van WAZA om het aantal dierentuinen en aquariums die betrokken zijn bij het behoud van wilde soorten en .</p>\r\n','','basic_html'),('tool',0,3,18,'en',0,'<p>An unbelievable multi-tool ba bla bla bla bla <a href=\"/en/taxonomy/term/37\">Waag</a></p>\r\n','','basic_html'),('tool',0,4,21,'en',0,'<p>Challenging exercise which brings out the best in all team members</p>\r\n','','basic_html');
